import React from "react";
import { Table, Button, Jumbotron, InputGroup } from "reactstrap";

export default (props) => {
    return (
        <div>
            <Jumbotron>
                <h1 className="display-4" align="center">
                    Atualiza preço de Produto
                </h1>
            </Jumbotron>
            <Table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Preço de custo</th>
                        <th>Preço de venda</th>
                    </tr>
                </thead>
                <tbody></tbody>
            </Table>

            <InputGroup>
        <InputGroupAddon addonType="prepend">
          <InputGroupText>Margem de Lucro (%):</InputGroupText>
        </InputGroupAddon>
        <Input placeholder="username" />
      </InputGroup>

            <div disp>
                <label htmlFor="margem">Margem de Lucro (%):</label>
                <input
                    type="text"
                    className="form-control"
                    id="margemLucro"
                    required
                    // value={this.state.cpf}
                    // onChange={this.onChangeCpf}
                    name="margemLucro"
                />
            </div>
            <Button color="secondary">Atualizar preço</Button>{" "}
        </div>
    );
};
